import React from 'react';

const Rankings = ({players}) => {
    return (
        <div> 
             <center><h1>Contact List</h1></center>
            {players.map((player) => (
                <h5 class="card-title">{player.name}</h5>
            ))}
        </div>
    )
}

export default Rankings
